import React, { Component } from 'react';
import'./game.css'

export default class Game extends Component {

    render() {
        return (
            <div className='game'>
                <div className='cell' id='duel1'></div>
                <div className='cell' id='duel2'></div>
                <div className='cell' id='duel3'
                ></div>
                <div className='cell' id='duel4'
                ></div>
                <div className='cell' id='duel5'
                ></div>

                <div className='cell' id='duel6'
                     style={{
                         width: this.props.x,
                         height: this.props.x
                     }}></div>
                <div className='cell' id='duel7'
                     style={{
                         'width': this.props.sizeEasyMode,
                         'height': this.props.sizeEasyMode
                     }}></div>
